import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and focus on it
    await page.waitForSelector('#searchInput');
    await page.focus('#searchInput');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_focused.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_focused.png'));

    // Type search term to trigger autocomplete
    await page.type('#searchInput', 'iPhone', { delay: 100 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_typed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_typed.png'));

    // Wait for autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_autocomplete_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_autocomplete_visible.png'));

    // Extract autocomplete suggestions
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    // Verify autocomplete functionality
    const extractedData = {
      searchTerm: 'iPhone',
      suggestionsCount: suggestions.length,
      suggestions: suggestions.slice(0, 5) // First 5 suggestions
    };

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and capturing suggestions",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete search autocomplete test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
